-- ----------------------------
-- Table structure for book_info
-- ----------------------------
DROP TABLE IF EXISTS `book_info`;
CREATE TABLE `book_info`  (
  `isbn` varchar(25) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT 'isbn',
  `book_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '书名',
  `author` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '作者',
  `publisher` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '出版社',
  `total_stock` int NULL DEFAULT NULL COMMENT '总库存',
  `present_stock` int NULL DEFAULT NULL COMMENT '当前库存',
  `status` int NOT NULL DEFAULT 0 COMMENT '0正常，1暂停借阅',
  `book_location` int NULL DEFAULT NULL COMMENT '0三水，1广州，2三水广州',
  `book_pic` longtext CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '图书图片',
  `book_description` varchar(512) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '图书简介',
  `category_id` int NOT NULL COMMENT '类别号',
  `enter_time` datetime NULL DEFAULT CURRENT_TIMESTAMP COMMENT '入库时间',
  `update_time` datetime NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`isbn`) USING BTREE,
  INDEX `foregin_category_id`(`category_id`) USING BTREE,
  CONSTRAINT `foregin_category_id` FOREIGN KEY (`category_id`) REFERENCES `category` (`category_id`) ON DELETE RESTRICT ON UPDATE RESTRICT
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

