DROP TABLE IF EXISTS `book_stock`;
CREATE TABLE `book_stock`  (
  `book_id` int NOT NULL AUTO_INCREMENT COMMENT '图书Id',
  `isbn` varchar(25) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT 'isbn',
  `status` int NOT NULL COMMENT '0, 未被借；1，被借',
  `book_location` int NULL DEFAULT NULL COMMENT '0三水，1广州',
  PRIMARY KEY (`book_id`) USING BTREE,
  INDEX `foreign_isbn`(`isbn`) USING BTREE,
  CONSTRAINT `foreign_isbn` FOREIGN KEY (`isbn`) REFERENCES `book_info` (`isbn`) ON DELETE RESTRICT ON UPDATE RESTRICT
