-- ----------------------------
-- Table structure for borrow
-- ----------------------------
DROP TABLE IF EXISTS `borrow`;
CREATE TABLE `borrow`  (
  `borrow_id` int NOT NULL AUTO_INCREMENT COMMENT '借阅号',
  `book_id` int NOT NULL COMMENT '书Id',
  `reader_id` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '读者Id',
  `borrow_time` datetime NULL DEFAULT CURRENT_TIMESTAMP COMMENT '借书时间',
  `return_time` datetime NULL DEFAULT NULL COMMENT '还书时间',
  `operator` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '操作员',
  `fine` int NULL DEFAULT 0 COMMENT '0时未存在罚款，大于0时存在罚款',
  `status` int NOT NULL COMMENT '0已借未还，1已还，2预约未拿',
  `renew` int NULL DEFAULT 0 COMMENT '0无续借，1当前续借状态',
  PRIMARY KEY (`borrow_id`) USING BTREE,
  INDEX `foreign_readerid`(`reader_id`) USING BTREE,
  INDEX `foreign_bookid`(`book_id`) USING BTREE,
  CONSTRAINT `foreign_bookid` FOREIGN KEY (`book_id`) REFERENCES `book_stock` (`book_id`) ON DELETE RESTRICT ON UPDATE RESTRICT,
  CONSTRAINT `foreign_readerid` FOREIGN KEY (`reader_id`) REFERENCES `user` (`user_id`) ON DELETE RESTRICT ON UPDATE RESTRICT
) ENGINE = InnoDB AUTO_INCREMENT = 37 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

